// Level renderer component
const LevelRenderer = ({ level, gameState }) => {
  return (
    <div className="level-container" style={{ backgroundColor: level.backgroundColor }}>
      <h2 className="level-name">{level.name}</h2>
      <p className="level-description">{level.description}</p>

      {/* Render level elements */}
      {level.elements.map((element, index) => {
        switch(element.type) {
          case LEVEL_TYPES.PLATFORM:
            return (
              <div 
                key={index} 
                className="platform"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          case LEVEL_TYPES.MOVING:
            return (
              <div 
                key={index} 
                className="platform moving"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          case LEVEL_TYPES.BOUNCE:
            return (
              <div 
                key={index} 
                className="platform bounce"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          case LEVEL_TYPES.COLLECTABLE:
            return (
              <div 
                key={index} 
                className="collectable"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`
                }}
              />
            );
          case LEVEL_TYPES.FINISH:
            return (
              <div 
                key={index} 
                className="finish"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`
                }}
              />
            );
          case LEVEL_TYPES.ENEMY:
            return (
              <div 
                key={index} 
                className="enemy"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          case LEVEL_TYPES.SPIKE:
            return (
              <div 
                key={index} 
                className="spike"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          case LEVEL_TYPES.DISAPPEARING:
            return (
              <div 
                key={index} 
                className="platform disappearing"
                style={{
                  left: `${element.x}%`,
                  bottom: `${element.y}%`,
                  width: `${element.width}%`,
                  height: `${element.height}%`
                }}
              />
            );
          default:
            return null;
        }
      })}
    </div>
  );
};

