        <p>{level.description}</p>
      </div>

      <LevelRenderer level={level} />

      <div className="level-hints">
        <h4>Hints:</h4>
        <ul>
          {level.hints.map((hint, index) => (
            <li key={index}>{hint}</li>
          ))}
        </ul>
